let img;
let font;

let logo = 0;
let cooldown = 0;

let usdLastPrice = -1;
let btcLastPrice = -1;

let usdApi = "https://api.binance.com/api/v3/ticker/24hr?symbol=DGBUSDT";
let btcApi = "https://api.binance.com/api/v3/ticker/24hr?symbol=DGBBTC";
let usd;
let btc;

function usdCallback(data) {
  if (usdLastPrice != -1)
    usdLastPrice = usd.lastPrice;
  else
    usdLastPrice = data.lastPrice;
  usd = data;
}
function btcCallback(data) {
  if (btcLastPrice != -1)
    btcLastPrice = btc.lastPrice;
  else
    btcLastPrice = data.lastPrice;
  btc = data;
}
function usdECallback(data) {
  usd = {
    lastPrice: "t.me/RenzoDD"
  };
}
function btcECallback(data) {
  btc = {
    lastPrice: "t.me/RenzoDD"
  };
}

function preload() {
  img = {
    logos: [
      loadImage("data:image/png;base64,"),
      loadImage("data:image/png;base64,"),
      loadImage("data:image/png;base64,")
    ],
    digiasset: [
      loadImage("data:image/png;base64,")
    ]
  }
  font = [
    loadFont("data:@file/x-font-ttf;base64,")
  ]
  usd = {
    lastPrice: "Price in"
  };
  btc = {
    lastPrice: "Price in"
  };
}
function setup() {
  createCanvas(300, 150);
  textFont(font[0]);
  textAlign(CENTER)
  fill("#FFFFFF")
  loadJSON(usdApi, usdCallback, usdECallback);
  loadJSON(btcApi, btcCallback, btcECallback);
}

function draw() {
  background("#002352");
  image(img.logos[logo], 20, 20);
  image(img.digiasset[0], 270, 120);

  textSize(25)
  fill('#FFFFFF');
  text("DigiByte\nPrice Monitor", 190, 40);

  textSize(20)

  if (float(usd.lastPrice) < float(usdLastPrice))
    fill('#F6465D');
  else if (float(usd.lastPrice) > float(usd.prevClosePrice))
    fill('#0ECB81')
  else
    fill('#BEC3CA');


  text(usd.lastPrice + " USD", 190, 110)

  if (usd.priceChangePercent) {
    if (usd.priceChangePercent[0] == '-')
      fill('#F6465D');
    else
      fill('#0ECB81');
  }


  text((usd.priceChangePercent || 0) + " %", 65, 135)



  if (float(btc.lastPrice) < float(btcLastPrice))
    fill('#F6465D');
  else if (float(btc.lastPrice) > float(btcLastPrice))
    fill('#0ECB81')
  else
    fill('#BEC3CA');

  text(btc.lastPrice + " BTC", 190, 135)

  if (millis() - cooldown >= 5000) {
    cooldown = millis();
    logo = (logo + 1) % 3

    loadJSON(usdApi, usdCallback, usdECallback);
    loadJSON(btcApi, btcCallback, usdECallback);

  }
}